import React from 'react';
import { Route, Switch, BrowserRouter} from "react-router-dom"
import logo from './logo.svg';
import './App.css';

export const App = props => {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello
        </p>
      </header>
    </div>
  );
}

export default App;
